import React from 'react';
import './OvensView.css'
import OvenItem from './OvenItem';

const OvensView=({oven_status,setups_status})=>{
    return(
        <div className="ovenItems" >
            <OvenItem ovenData={oven_status} setupData={setups_status}/>
        </div>
    )
};

export default OvensView;
